@boother 

If you change

```
void TfLiteGpuDelegateDelete(TfLiteDelegate* delegate);
```

to

```
TFL_CAPI_EXPORT void TfLiteGpuDelegateDelete(TfLiteDelegate* delegate);
```

things should work.  I will fix this in the internal repository; it may take a bit to be reflected on the open source repository.

