The internal check also failed. I'm guessing it is caused by the style [here](https://github.com/tensorflow/tensorflow/pull/27969/files#diff-ba4d21ca0c437c902fd8c791e06ba44dR42). It may need to be changed as below:
```C++
for (int i = 0; i < length; ++i) {
    if (flat_t1(i) != flat_t2(i)) {
      return tensorflow::errors::Internal(
          "Two tensors have different values at [", i, "]: ", flat_t1(i),
          " vs. ", flat_t2(i));
    }
}
```
